import React from "react";
import "./App.css";
import {HashRouter, Route} from "react-router-dom";
import Table from "./components/Table";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <div>
          <Table props={props.match.params[0] || "#"} {...props} />
          )} />
        </div>
      </BrowserRouter>
    </div>
  );
}

export default App;
